import React from 'react';
import './Background.css';

const Background = () => {
  return (
    <div className="background-container">
      <div className="watercolor-wash wash-1"></div>
      <div className="watercolor-wash wash-2"></div>
      <div className="watercolor-wash wash-3"></div>
      <div className="leaf-motif leaf-1"></div>
      <div className="leaf-motif leaf-2"></div>
    </div>
  );
};

export default Background;
